@市川さん Slack社の営業担当にお問い合わせするか、みたいな話があったかと思うのですが、その後進展ありますでしょうか。
どうも日本のSlack社の営業って4人しかいないみたいでして、JVの関係で榊原さんが既にアポ取ってるみたいで、取り次いでくれるみたいです。
という共有でした。余計なことになっちゃったらすみません。

明日の10:30にSlackの営業とWeb会議をすることになりました。
聞きたいことあれば、事前に伝えておくのでご連絡ください！
@Ets（18日は休み） @TakuUnno @micchie @inouetakuya

2018年02月06日（火）16:00 ～ 17:00
Slackのエンジニアが来てくれるそうなので、仮で会議室おさえてます。
